description:
PLOT: 
Dick is faced with a series of brutal murders in which the victims, all from different social and economic backgrounds, are viciously slashed to pieces. Suspects abound but Tracy, getting a clue that there will be fifteen murders in all, must find the common thread among the victims before more are killed.            

ACTORS: 
Morgan Conway, Anne Jeffreys, Mike Mazurki, Jane Greer, Lyle Latell, Joseph Crehan, Mickey Kuhn, Trevor Bardette, Morgan Wallace, Milton Parsons, William Halligan, Sam Ash, Gertrude Astor, Tanis Chandler, Jack Chefe, Mary Currier, Robert Douglas, Ralph Dunn, Bruce Edwards, Edythe Elliott, Franklyn Farnum, Carl Faulkner, Jack Gargan, Edmund Glover, Carl Hanson, Jimmy Jordan, Mike Lally, Wilbur Mack, George Magrill, Alphonse Martell, Frank Meredith, Harold Miller, Bruce Mitchell, Tommy Noonan, Florence Pepper, Bob Reeves, Jason Robards Sr., Harry Strang, Don Wilson, 

RELEASED: 
 1 December 1945 

